804 \uc6b0\uc6b8\uc99d \ub4f1 \uc5ec\ub7ec\uac00\uc9c0 \uc774\uc720\ub85c \ud53c\uc784\uc57d\uc744 \uc774\uc6a9\ud560 \uc218 \uc788\ub2f5\ub2c8\ub2e4!\n\n(+)\n\n\uadf8 \uc0ac\uc774 \uc0c8\ud574\uac00 \ubc1d\uc558\uc5b4\uc694!\n\n\uc9c0\ub09c \ud55c \ud574\uc5d0\ub3c4 \ud568\uaed8\ud574\uc8fc\uc154\uc11c \uac10\uc0ac\ud588\uc2b5\ub2c8\ub2e4 :) \ub355\ubd84\uc5d0 \uc870\uae08 \ub35c \uc678\ub86d\uace0, \uc870\uae08 \ub354 \uc6a9\uae30\ub0b4\ub294 \uc2dc\uac04\uc774 \uc788\uc5c8\uc5b4\uc694. \uc5b4\ub518\uac00\uc5d0\ub294 \ub098\uc640 \ub610 \ub098\uc758 \uc774\uc57c\uae30\uc5d0 \ub098\ub3c4 \uadf8\ub7ac\uc5b4, \ub77c\uace0 \ub9d0\ud574\uc8fc\ub294 \uc0ac\ub78c\uc774 \uc788\ub2e4\ub294 \uc0dd\uac01\ub9cc\uc73c\ub85c \uc704\ub85c\uac00 \ub418\uace0 \ud798\uc774 \ub098\ub294 \uc21c\uac04\ub4e4\uc774 \uc788\uc796\uc544\uc694. \ub9d0\ud574\uc8fc\uc9c0 \uc54a\uc73c\uc2e0 \uac83\ub4e4\uae4c\uc9c0\ub3c4 \uc77d\uc5b4\uc9c0\ub294 \uac83\ub4e4\uc774 \uc788\uc5b4\uc694.\n\n\uae30\ud68c\ub97c \uc8fc\uc2dc\uace0 \ub5a0\uc62c\ub824\uc8fc\uc2e0 \ub9ce\uc740 \ubd84\ub4e4\uaed8\ub3c4 \ub2e4\uc2dc\uae08 \uac10\uc0ac\ub97c \uc804\ud574\uc694. \uc8fc\uc2e0 \uae30\ud68c\ub4e4\uc774 \ub354 \ub9ce\uc740 \uac83\ub4e4\uc744 \uadf8\ub824\ub0b4\uace0 \ub3c4\uc804\ud558\uace0 \uc2f6\uc740 \ub2e8\ub2e8\ud55c \ubc14\ub2e5\uc774 \ub418\uc5b4\uc8fc\uc5c8\uc5b4\uc694.\n\n\uc6b0\ub9ac \uac01\uc790\uc758 \uc790\ub9ac\uc5d0\uc11c \uc77c\uc0c1\uc744 \uafcb\uafcb\ud788 \uc0b4\uc544\uac00\ub294, \ub354 \uc120\ud558\uace0 \uc62c\ubc14\ub974\uace0 \ud589\ubcf5\ud55c \ud55c \ud574\uac00 \ub418\uae30\ub97c \ubc14\ub77c\uc694. \ub108\ubb34 \ud798\ub4e4\uba74 \uadf8\ub0e5 \ub354 \ub300\ucda9 \uc0b4\uc544\ub0a8\uae30\ub9cc \ud574\ub3c4 \uc88b\uad6c\uc694.\n\n\uc0c8\ud574 \ubcf5 \ub9ce\uc774 \ubc1b\uc73c\uc138\uc694!\n\n#\ube44\ucc28\uc758\uce98\ub9ac\ud230 #\ub7ec\ube0c\ud50c\ub79c #\ucf5c\ub77c\ubcf4\uc6f9\ud230"}}]},"edge_media_to_comment":{"count":58},"comments_disabled":false,"taken_at_timestamp":1641195435,"e
